class Users {
  num? id;
  String? firstName;
  String? lastName;
  String? chatText;
  String? profileImage;
  String? time;

  Users(
      {required this.id,
      required this.firstName,
      required this.lastName,
      required this.chatText,
      required this.profileImage,
      required this.time});
  static List<Users> generateUsers() {
    return [
      Users(
        id: 1,
        firstName: 'Cecily',
        lastName: 'Trujillo',
        chatText: 'Awesome Setup',
        profileImage: 'assets/profile_pic/userImage1.jpeg',
        time: 'Now',
      ),
    ];
  }
}
